{"url": "https://www.imdb.com/title/tt14129378/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt14129378/", "name": "Killing It", "image": "https://m.media-amazon.com/images/M/MV5BZWYyZTcwYzItMWRmNC00OGUwLWJmM2YtN2NiY2Y5ZjBjZWRhXkEyXkFqcGdeQXVyMTMxNjUyMDkx._V1_.jpg", "description": "Class, capitalism and one man&apos;s quest to achieve the American dream.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt14129378/"}, "author": {"@type": "Person", "name": "sellashaw"}, "dateCreated": "2022-04-19", "inLanguage": "English", "name": "Surprisingly grasping", "reviewBody": "The first two episodes left me uninterested, however the season does pick up fast! I liked how the different sub plots of each character were shown and then brought together. I wasn&apos;t really interested in the snake competition all season - except for the last episode! I loved the chemistry between Craig and Claudia and they are both funny in their own ways. I was surprised by how much I liked this show considering the first episode was bland and I hope there is a next season!", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 2071, "bestRating": 10, "worstRating": 1, "ratingValue": 7.1}, "contentRating": "TV-MA", "genre": ["Comedy"], "datePublished": "2022-03-31", "keywords": "sitcom comedy,quest,single father", "actor": [{"@type": "Person", "url": "/name/nm0732497/", "name": "Craig Robinson"}, {"@type": "Person", "url": "/name/nm5307166/", "name": "Claudia O&apos;Doherty"}, {"@type": "Person", "url": "/name/nm3790579/", "name": "Rell Battle"}], "creator": [{"@type": "Organization", "url": "/company/co0046592/"}, {"@type": "Person", "url": "/name/nm1472469/", "name": "Luke Del Tredici"}, {"@type": "Person", "url": "/name/nm0329634/", "name": "Dan Goor"}], "trailer": {"@type": "VideoObject", "name": "Official Trailer", "embedUrl": "/video/imdb/vi88982297", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BYzBmYWI3ZmQtY2Q5Yi00MDQwLTgzZDYtZjBkYTgxNzRhMWE4XkEyXkFqcGdeQWxiaWFtb250._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BYzBmYWI3ZmQtY2Q5Yi00MDQwLTgzZDYtZjBkYTgxNzRhMWE4XkEyXkFqcGdeQWxiaWFtb250._V1_.jpg", "description": "A comedy about class, capitalism and one man&apos;s quest to achieve the American dream. And also about hunting really big snakes."}}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt14129378/"], ["og:site_name", "IMDb"], ["og:title", "Killing It (TV Series 2022\u2013 ) - IMDb"], ["og:description", "Killing It: Created by Luke Del Tredici, Dan Goor. With Craig Robinson, Claudia O'Doherty, Rell Battle, Scott MacArthur. Class, capitalism and one man's quest to achieve the American dream."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BZWYyZTcwYzItMWRmNC00OGUwLWJmM2YtN2NiY2Y5ZjBjZWRhXkEyXkFqcGdeQXVyMTMxNjUyMDkx._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1481.9102749638205"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
