{"url": "https://www.imdb.com/title/tt12592252/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt12592252/", "name": "Songbird", "image": "https://m.media-amazon.com/images/M/MV5BZDA1MTYxNjctYjQyOS00OTQ2LWFkNGMtMmZkNDg0ZDNjNDYyXkEyXkFqcGdeQXVyNjY1MTg4Mzc@._V1_.jpg", "description": "In 2024 a pandemic ravages the world and its cities. Centering on a handful of people as they navigate the obstacles currently hindering society: disease, martial law, quarantine, and vigilantes.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt12592252/"}, "author": {"@type": "Person", "name": "tresm87"}, "dateCreated": "2020-12-11", "inLanguage": "English", "name": "An absolutely dull and cheap film trying to bank on the current times and failing just about every step of the way.", "reviewBody": "When this was announced it had Michael Bay&apos;s name attached as producer and was supposedly going to be a pandemic thriller. Now I know many people have a disdain for Michael Bay, but I actually think that he brings some visual prowess to his projects however it&apos;s clear that his name was only attached for recognition purposes. This is neither anything visually bombastic or anything close to being a pulse pounding thriller. It&apos;s a very amateur romantic drama that focuses more on the interpersonal communication between characters as they struggle through the changing times. It becomes increasingly dragging and you just keep asking yourself what the real intent of the overall film really is. Some of the actors are seasoned veterans but are truly underutilized for new or younger actors that are frankly not on par. The production value is that of a cancelled TV series on the big networks as well. Overall this is just a very big failure and definitely not what I was expecting.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 2}}, "aggregateRating": {"@type": "