{"url": "https://www.imdb.com/title/tt0118254/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0118254/", "name": "Ally McBeal", "image": "https://m.media-amazon.com/images/M/MV5BMTg1NTI0MTUxMl5BMl5BanBnXkFtZTcwODE1MzgyMQ@@._V1_.jpg", "description": "Follows the personal and professional life of lawyer Ally.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0118254/"}, "author": {"@type": "Person", "name": "Shapster11"}, "dateCreated": "2001-02-18", "inLanguage": "English", "name": "The &quot;Anti&quot; L.A.Law", "reviewBody": "For David Kelly the creation of this law firm must have come to him as he envisioned what L.A.Law would&apos;ve been in it&apos;s most bizarre form. If you told viewers beforehand some of the quirks and cases the main character, and the firm, would entertain I&apos;m sure the &quot;test&quot; audience would have responded with a collective thumbs down. This is why the success and following of the show is all the more astounding.\n\nI have watched from the first episode and look forward to it every week. From the first time we saw Ally get sexually harassed in her old firm, to her first sighting of the baby cupid on roller skates with a bow and arrow we have embraced her quirks and her flaws. We have hung on every &quot;theme song&quot;, everytime she saw Al Green and most recently Barry Manilow, and we have learned to clutch onto all the zaniness of the other characters as well.\n\nBe it John Cage stuttering(pa..pa..pa..poughkeepsie), to the great &quot;Fishisms&quot; of his partner Richard Fish, to Billy&apos;s Robert Palmer girls, to Elaine&apos;s face bra, etc. etc. These characters are now part of our tuesday conversation at the water cooler. And in America that is when a show has made it!\n\nSeason three had it&apos;s mindnumbing sameness to it, but the introduction of Robert Downey Jr. has brought new life to a stagnant show. At the time of this