{"url": "https://www.imdb.com/title/tt0115355/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0115355/", "name": "Silent Witness", "image": "https://m.media-amazon.com/images/M/MV5BMmFjNmI4OGItZDc4Yi00MDkxLWFkNjctODliNTI1ODU1NTAyXkEyXkFqcGdeQXVyMjY0NzE3NzQ@._V1_.jpg", "description": "Crimes through the eyes of a team of forensic pathologists and forensic scientists.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0115355/"}, "author": {"@type": "Person", "name": "lorraineesimpson"}, "dateCreated": "2016-01-25", "inLanguage": "English", "name": "Daft but watchable", "reviewBody": "Silent Witness is a good British crime drama. The acting is decent, the scripts are okay(but sometimes verge on dodgy), and it keeps you interested in the story. As in all good crime dramas it&apos;s often quite difficult to accurately guess &apos;whodunnit&apos;. \n\nHowever I&apos;m stunned to read some of the other reviewers who describe it as realistic. Realistic?!? I don&apos;t think so ... \n\nI&apos;m sure Forensics and pathology is a hugely interesting and rewarding career, exciting in it&apos;s own way. I&apos;m also equally sure that they don&apos;t assume control of police investigations, interrogate suspects and get so embroiled in the culprits or victims private lives that they often find themselves staring down the barrel of a gun or two. \n\nIn this respect it&apos;s hugely unrealistic - almost as unrealistic as the thought that anyone as whiny, interfering and annoying as Dr Nikki Alexander (played by Emilia Fox) wouldn&apos;t have been locked in a laboratory cupboard and forgotten about just to give everyone some respite.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 9560, "bestRating": 10, "worstRating": 1, "ratingValue": 7.9}, "contentRating": "TV-14", "genre": ["Crime", "Drama", "Mystery"], "datePublished": "1996-02-21", "keywords": "rape,forensic pathologist,female full frontal nudity,caucasian,pubic hair", "actor": [{"@type": "Person", "url": "/name/nm0288976/", "name": "Emilia Fox"}, {"@type": "Person", "url": "/name/nm0303946/", "name": "William Gaminara"}, {"@type": "Person", "url": "/name/nm5290610/", "name": "David Caves"}], "creator": [{"@type": "Organization", "url": "/company/co0043107/"}, {"@type": "Organization", "url": "/company/co0056790/"}, {"@type": "Organization", "url": "/company/co0030734/"}], "trailer": {"@type": "VideoObject", "name": "Series 24 Trailer", "embedUrl": "/video/imdb/vi296338201", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BY2Y3YzcwYzQtMGFmNy00OGZmLWE1NTAtZjdiMzM5ZmMxNTZlXkEyXkFqcGdeQWxiaWFtb250._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BY2Y3YzcwYzQtMGFmNy00OGZmLWE1NTAtZjdiMzM5ZmMxNTZlXkEyXkFqcGdeQWxiaWFtb250._V1_.jpg", "description": "Forensic pathologists face personal and professional challenges in a moody, tense thriller that moves from the crime scene to the lab."}}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0115355/"], ["og:site_name", "IMDb"], ["og:title", "Silent Witness (TV Series 1996\u2013 ) - IMDb"], ["og:description", "Silent Witness: With Emilia Fox, William Gaminara, David Caves, Tom Ward. Crimes through the eyes of a team of forensic pathologists and forensic scientists."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMmFjNmI4OGItZDc4Yi00MDkxLWFkNjctODliNTI1ODU1NTAyXkEyXkFqcGdeQXVyMjY0NzE3NzQ@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1497.2436604189636"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alterna