{"url": "https://www.imdb.com/title/tt3244446/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt3244446/", "name": "Bleeding Heart", "image": "https://m.media-amazon.com/images/M/MV5BMTg2MDY3MTEzOV5BMl5BanBnXkFtZTgwNzQ2ODcwNzE@._V1_.jpg", "description": "A yoga instructor looks to protect her sex-worker sister from her deadbeat boyfriend.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt3244446/"}, "author": {"@type": "Person", "name": "aporlando"}, "dateCreated": "2015-11-06", "inLanguage": "English", "name": "An empowering film with a great cast.", "reviewBody": "What is it that ties ours hands thus keeping us from helping another human being; we each feel this urge to be a good person, but often stopping short of accomplishing anything. So many times we are pulled the opposite way by those interfering; for once can someone please have a spine, and stand up tall. Bleeding Heart filled these expectations, and in a big way. \n\nThere were several movies I wanted to watch tonight, and I am glad I picked this first. Jessica Beil and Zosia Mamet carried the movie with a relationship which showed superb acting, and supporting actors played perfect roles with setting up the stage of the movie.\n\nA little known fact, the three brothers that made up Warner Brothers specifically chose to produce movies which had a point to them, hoping the audience would learn something. Watch this movie and let me know if you thought there were characters that their actions just turned your stomach inside out, while others in the script empowered you.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 8}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 2137, "bestRating": 10, "worstRating": 1, "ratingValue": 5}, "contentRating": "TV-MA", "genre": ["Drama"], "datePublished": "2015-11-03", "keywords": "woman murders a man,woman with a gun,woman in j