{"url": "https://www.imdb.com/title/tt2034297/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVEpisode", "url": "/title/tt2034297/", "name": "Double Take", "image": "https://m.media-amazon.com/images/M/MV5BNDE0MzY3NjQ4NV5BMl5BanBnXkFtZTcwNjI3MDgwOA@@._V1_.jpg", "description": "The Smart Dust control unit is still on the fritz and wreaking havoc on the town&apos;s communications systems. The bio-printer has gone missing and Holly (Felicia Day) is definitely not herself.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt2034297/"}, "author": {"@type": "Person", "name": "GunnersMate"}, "dateCreated": "2018-06-10", "inLanguage": "English", "name": "Dark Zombie Feel", "reviewBody": "Double Take is the penultimate episode of the Eureka series and the second half of a two-part tale that began with Mirror, Mirror. It is largely dark with a zombie-movie feel, and it works. The duplicate replicants from Mirror, Mirror are everywhere, the future looks pretty bleak, and there is a ton of entertainment in watching the good people of Eureka try to defend themselves from...themselves. YES, the &quot;oh, that&apos;s completely reasonable&quot; aspect of science fiction is pushed well beyond the boundaries of rational thought, but that&apos;s the fun of life in Eureka. The final episode is set up during this outing and there is a certain sadness in knowing that we won&apos;t be able to visit Eureka, Oregon in the very near future. At least everyone was at their best on the way out the door.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 8}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 339, "bestRating": 10, "worstRating": 1, "ratingValue": 8.2}, "contentRating": "TV-PG", "genre": ["Adventure", "Comedy", "Drama"], "datePublished": "2012-07-09", "keywords": "continued from previous episode,doppelganger,abduction", "actor": [{"@type": "Person", "url": "/name/n