{"url": "https://www.imdb.com/title/tt2058303/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt2058303/", "name": "Fresh Meat", "image": "https://m.media-amazon.com/images/M/MV5BZGVhOTQ4YTktM2JkMy00MDlmLWI0NmQtMmUxMWU4MWJmNTExXkEyXkFqcGdeQXVyNjg0NTcxMTg@._V1_.jpg", "description": "A comedy that follows a group of six students about to embark on the most exciting period of their lives so far, university.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt2058303/"}, "author": {"@type": "Person", "name": "AMichaelL"}, "dateCreated": "2012-01-11", "inLanguage": "English", "name": "Relatability on an international scale!", "reviewBody": "This show reminds me of a much wittier, much dirtier version of Apatow&apos;s &apos;Undeclared&apos;. I found this show from looking into the shows related to The Inbetweeners, which I always found cheesy but extremely watchable. I found out Joe Thomas (Simon Cooper in Inbetweers) was in this college comedy and I became intrigued. Then, I watched a few episodes and I was sold.\n\nThis is one of the better college comedy shows that has come around in a while, and considering how deep on the net I had to dig to find out about it, I am sure it is massively under-watched in the U.S. Hopefully it gets up on Netflix or something so it can get some recognition over here.\n\nThere are plenty of clich\u00e9 situations, but these are clich\u00e9s because they truly do tend to happen to everyone who attends college, whether in the U.S. or the U.K or wherever. I love the unique blending of characters and the filter-less nature of the dialogue. Anyone in college, recently graduated, or seeking some nostalgia should have no problem relating to the relationship drama, the wit, the parties, and the sense of confusion which naturally arise from throwing a bunch of young people into one small area (be it the college on a larger scale, or the house/dorm on a smaller one).", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 17799, "bestRating": 10, "worstRating": 1, "ratingValue": 7.8}, "contentRating": "TV-MA", "genre": ["Comedy", "Drama"], "datePublished": "2011-09-21", "keywords": "university,group of friends,sitcom,academia drama,coming of age", "actor": [{"@type": "Person", "url": "/name/nm1534698/", "name": "Zawe Ashton"}, {"@type": "Person", "url": "/name/nm2925526/", "name": "Greg McHugh"}, {"@type": "Person", "url": "/name/nm2632878/", "name": "Kimberley Nixon"}], "creator": [{"@type": "Organization", "url": "/company/co0225068/"}, {"@type": "Organization", "url": "/company/co0115168/"}, {"@type": "Person", "url": "/name/nm1104036/", "name": "Jesse Armstrong"}, {"@type": "Person", "url": "/name/nm1095060/", "name": "Sam Bain"}], "trailer": {"@type": "VideoObject", "name": "Trailer: Season 4", "embedUrl": "/video/imdb/vi2039135769", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMmM4YjI0ZTktZDMwZS00NzFkLThkODgtY2JhODQyNDEwMTU2XkEyXkFqcGdeQXRyYW5zY29kZS13b3JrZmxvdw@@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMmM4YjI0ZTktZDMwZS00NzFkLThkODgtY2JhODQyNDEwMTU2XkEyXkFqcGdeQXRyYW5zY29kZS13b3JrZmxvdw@@._V1_.jpg", "description": ""}}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt2058303/"], ["og:site_name", "IMDb"], ["og:title", "Fresh Meat (TV Series 2011\u20132016) - IMDb"], ["og:description", "Fresh Meat: Created by Jesse Armstrong, Sam Bain. With Zawe Ashton, Greg McHugh, Kimberley Nixon, Charlotte Ritchie. A comedy that follows a group of six students about to embark on the most exciting period of their lives so far, university."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BZGVhOTQ4YTktM2JkMy00MDlmLWI0NmQtMmUxMWU4MWJmNTExXkEyXkFqcGdeQXVyNjg