{"url": "https://www.imdb.com/title/tt0790623/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0790623/", "name": "Bill", "alternateName": "Meet Bill", "image": "https://m.media-amazon.com/images/M/MV5BMTExNDk1MjAxNTJeQTJeQWpwZ15BbWU3MDc4MzkyNjE@._V1_.jpg", "description": "A guy fed up with his job and married to a cheating wife reluctantly mentors a rebellious teen.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0790623/"}, "author": {"@type": "Person", "name": "mhendersonny"}, "dateCreated": "2009-11-19", "inLanguage": "English", "name": "Light hearted indie-film", "reviewBody": "If you like Aaron Eckhart then you&apos;ll like this film. It&apos;s a departure from anything he&apos;s done in the past. Elizabeth Banks plays his wife, a beautiful, self obsessed, spoiled, rich bitch with no redeeming qualities except her looks and body. (It&apos;s VERY much the same role as she played in &quot;The Baxter&quot;. She&apos;s really got this character type down and is carving a niche for herself in indie films.)\n\nAs I watched this movie, I thought that it reminded me of those indie films that I loved from the late 90&apos;s and early 2000&apos;s and how they just don&apos;t make them like this anymore. I didn&apos;t laugh all the way through this movie, but there were places where I chuckled (considerably) and I did have a smirk on my face for a good bit of the movie. (Think &quot;The Ex&quot; but not as funny.)\n\nIt a great Friday night, too tired to think, order a pizza and veg movie. And if you like indie films from a decade ago, then you&apos;ll be glad you rented this one.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 20281, "bestRating": 10, "worstRating": 1, "ratingValue": 6.2}, "contentRating": "R", "genre": ["Comedy", "Drama"], "datePublished": "2008-06-18", "