{"url": "https://www.imdb.com/title/tt3915422/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVEpisode", "url": "/title/tt3915422/", "name": "Wingman", "image": "https://m.media-amazon.com/images/M/MV5BMjA5MjY4NTcxNF5BMl5BanBnXkFtZTgwOTM1NDE4MjE@._V1_.jpg", "description": "Finch recruits Fusco to stick close to the latest POI, a professional &quot;wingman&quot;, but learning how to approach women soon becomes the least of his worries. Meanwhile, Reese must find a way to play by the rules at his new day job as...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt3915422/"}, "author": {"@type": "Person", "name": "A_Different_Drummer"}, "dateCreated": "2015-05-17", "inLanguage": "English", "name": "&quot;my 3rd closed case today  ... wanted to make sure you didn&apos;t die before I had a chance to brag about it.&quot;", "reviewBody": "At the 38:00 minute mark of this massively entertaining episode Reese delivers this throwaway line.\n\nWhat is especially interesting is that he does it in a Clint Eastwood (Dirty Harry) voice (which BTW is very close to his own voice), and this is the precisely the sort of one-liner that, back in the day, they used to give to Clint.\n\nOf course, this could all be in my fevered imagination.\n\nOr, alternatively, the writing team behind this hit show is so darn far ahead of the curve that they knew that the &quot;new refurbished&quot; Reese was playing a cop (part of the re-imagining of the show discussed in my earlier reviews) and they simply could not resist.\n\nPersonally I think they could not resist.\n\nThe most amazing thing about this episode is how smooth the transitions are, like a well-aged Scotch. They are only three episodes into the fourth season, with the new &quot;story rules&quot; that they (the writers) imposed on themselves, yet the whole thing ticks along like a Swiss Watch.\n\nThis is not merely a hit show but a hit show that simply refuses to rest on its laurels.\n\nGreat episode", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 9}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 2472, "bestRating": 10, "worstRating": 1, "ratingValue": 8.5}, "contentRating": "TV-14", "genre": ["Action", "Crime", "Drama"], "datePublished": "2014-10-07", "keywords": "bag of money,envelope of money,duffel bag,machine,new boss", "trailer": {"@type": "VideoObject", "name": "Person Of Interest: Wing Man", "embedUrl": "/video/imdb/vi63552793", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BOGJjODY0ZWUtMzYwYy00YWExLTk5OTEtNzU4NjgyMzAyZGZkXkEyXkFqcGdeQXRyYW5zY29kZS13b3JrZmxvdw@@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BOGJjODY0ZWUtMzYwYy00YWExLTk5OTEtNzU4NjgyMzAyZGZkXkEyXkFqcGdeQXRyYW5zY29kZS13b3JrZmxvdw@@._V1_.jpg", "description": "Person Of Interest: Wing Man"}, "actor": [{"@type": "Person", "url": "/name/nm0001029/", "name": "Jim Caviezel"}, {"@type": "Person", "url": "/name/nm0152430/", "name": "Kevin Chapman"}, {"@type": "Person", "url": "/name/nm0009918/", "name": "Amy Acker"}], "director": [{"@type": "Person", "url": "/name/nm0870295/", "name": "Frederick E.O. Toye"}], "creator": [{"@type": "Organization", "url": "/company/co0355349/"}, {"@type": "Organization", "url": "/company/co0021593/"}, {"@type": "Organization", "url": "/company/co0005035/"}, {"@type": "Person", "url": "/name/nm0634300/", "name": "Jonathan Nolan"}, {"@type": "Person", "url": "/name/nm0781976/", "name": "Amanda Segel"}, {"@type": "Person", "url": "/name/nm1143319/", "name": "Dan Dietz"}], "duration": "PT44M", "timeRequired": "PT44M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt3915422/"], ["og:site_name", "IMDb"], ["og:title", "\"Person of Interest\" Wingman (TV Episode 2014) - IMDb"], ["og:description", "Wingman: Directed by Frederick E.O. Toye. With Jim Caviezel