{"url": "https://www.imdb.com/title/tt1839578/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt1839578/", "name": "Person of Interest", "image": "https://m.media-amazon.com/images/M/MV5BZDU1NzA5YzUtNTdmNy00NTVjLWFhNzEtYWI1NmNkNTA1ZDBhXkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_.jpg", "description": "An ex-CIA agent and a wealthy programmer save lives via a surveillance AI that sends them the identities of civilians involved in impending crimes. However, the details of the crimes, including the civilians&apos; roles, are left a mys...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt1839578/"}, "author": {"@type": "Person", "name": "kuashie"}, "dateCreated": "2014-11-15", "inLanguage": "English", "name": "You are being watched, the machine.", "reviewBody": "This is a cleverly made series with a kick ass plot, interesting acting and character and a very bad-ass hero. This series keeps you at the edge of your seat throughout, since its concept broadens the paths the series can take.\n\nThe premise of the show is kept intact unlike some other shows that are too afraid to stick to premise. Past and present events are placed well and strategically thus leaving no room for plot holes. There are a lot more good parts to it, but I leave it here.\n\nSeason 1 is good, season 2,3,4 are better. This show is definitely worth you time because it is delivered in every kind of flavor.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 9}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 174134, "bestRating": 10, "worstRating": 1, "ratingValue": 8.5}, "contentRating": "TV-14", "genre": ["Action", "Crime", "Drama"], "datePublished": "2011-09-22", "keywords": "artificial intelligence,ex cia agent,officially listed as dead,terror prediction,special operations", "actor": [{"@type": "Person", "url": "/name/nm0001029/", "name": "Jim Caviezel"}, {"@type": "