{"url": "https://www.imdb.com/title/tt4877736/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt4877736/", "name": "BrainDead", "image": "https://m.media-amazon.com/images/M/MV5BMTg4MzgzOTAyNl5BMl5BanBnXkFtZTgwNzYxNjg0ODE@._V1_.jpg", "description": "A government employee discovers that the cause of the tensions between the two political parties is a race of extraterrestrial insects eating the brains of the politicians.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt4877736/"}, "author": {"@type": "Person", "name": "atlasmb"}, "dateCreated": "2016-07-01", "inLanguage": "English", "name": "Ant-icipation Gives Way To Enjoyment", "reviewBody": "A comedy? A drama? Horror fiction? &quot;BrainDead&quot; is described as all three in IMDb, but I never referred to the website before watching the first three episodes. I expected a comedy, based upon television ads, so I watched episode one waiting for the moment when it diverged into that genre, but that moment never came. There were bizarre happenings that suggest a writer with a dark sense of humor, but the episode played like straight horror/drama, like &quot;Invasion of the Body Snatchers.&quot;\n\nStill, I felt there was an undercurrent of something political. Would the show reveal itself to be left-leaning (like most everything from the west coast) or would it use Trump l&apos;oeil to sway viewers to the right side? I watched episode two in anticipation. \n\nAlthough the main character, Laurel Healy (Mary Elizabeth Winstead), seems somewhat apolitical, she works for her brother, a Democratic senator, so much of the story originates from that point of view (and I think that&apos;s why some viewers think it espouses a left-of-center political viewpoint). But the barbs were evenly distributed on both sides of the aisle, I thought. I noticed that when Laurel didn&apos;t like the right-leaning political commentary on one channel, she switched to a left-leaning channel. This appears to be a more objective commentary that skewers the simplistic assertions of both extremes (and I use that term in a non-pejorative way).\n\nSo now I consider the show a mystery. What will it reveal itself to be? Will it remain a sci-fi/horror/centrist commentary about American politics and culture? I hope so.\n\nThe cast is excellent. I especially enjoy Ms. Winstead, who I had not seen before. She has an every&quot;man&quot; appeal and Laurel seems like someone you&apos;d like to know. She is more than the token &quot;person of conscience&quot; in D.C. that the first episode painted. Tony Shaloub plays a meaty role as Red Wheatus, the colorful Republican opponent of Laurel&apos;s brother. Johnny Ray Gill plays Gustav Triplett, a quirky genius who struggles to understand the odd happenings around him.\n\nUpdate 8/2/16: More than a handful of episodes in, this show has shown itself to be consistently interesting and adorable and intriguing--an unusual combination. I am raising my grade to &quot;9&quot;.\n\nUpdate 9/15/16: From the musical reminders of what happened in the previous episode to the way the show perfectly captures the BS that passes for activity in government to the insightful lampooning of PC-inspired nonsense, this show is forcing me to give it a &quot;10&quot; because it is one of the best in recent years. Besides, there&apos;s a nagging voice in my head compelling me to up my grade...and have a kelp shake.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 11230, "bestRating": 10, "worstRating": 1, "ratingValue": 8}, "contentRating": "TV-14", "genre": ["Comedy", "Drama", "Horror"], "datePublished": "2016-06-13", "keywords": "brother sister relationship,father daughter relationship,satire,the white house,possessed by a mind controlling alien parasite", "actor": [{"@type": "Person", "url": "/name/nm0935541/", "name": "Mary Elizabeth Winstead"}, {"@type": "Person", "url": "/name/nm0992694/", "name": "Danny Pino"}, {"@type": "Person", "url": "/name/nm3117836/", "name": "Aaron Tveit"}], "creator": [{"@type": "Organization", "url": "/company/co0259281/"}, {"@type": "Organization", "url": "/company/co0286028/"}, {"@type": "Organization", "url": "/company/co0274041/"}, {"@type": "Person", "url": "/name/nm0455080/", "name": "Michelle King"}, {"@type": "Person", "url": "/name/nm0455207/", "name": "Robert King"}], "trailer": {"@type": "VideoObject", "name": "Trailer #1 - &quot;Politics With a Twist&quot;", "embedUrl": "/video/imdb/vi4033197081", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMTU0Mzc5NzY1MV5BMl5BanBnXkFtZTgwODkwNzMxOTE@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMTU0Mzc5NzY1MV5BMl5BanBnXkFtZTgwODkwNzMxOTE@._V1_.jpg", "description": "A young, fresh-faced Hill staffer gets her first job in Washington, D.C. to discover two things: The government has stopped working, and alien spawn have come to earth and eaten the brains of a growing number of Congressmen and Hill staffers."}}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt4877736/"], ["og:site_name", "IMDb"], ["og:title", "BrainDead (TV Series 2016) - IMDb"], ["og:description", "BrainDead: Created by Michelle King, Robert King. With Mary Elizabeth Winstead, Danny Pino, Aaron Tveit, Tony Shalhoub. A government employee discovers that the cause of the tensions between the two political parties is a race of extraterrestrial insects eating the brains of the politicians."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTg4MzgzOTAyNl5BMl5BanBnXkFtZTgwNzYxNjg0ODE@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1483.3005893909628"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
