{"url": "https://www.imdb.com/title/tt4679206/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVEpisode", "url": "/title/tt4679206/", "name": "The Day the World Went Away", "image": "https://m.media-amazon.com/images/M/MV5BN2U5M2JkYWEtZmVjNC00MjcwLWFmOTQtNWUyNjRkNzA5MjY1XkEyXkFqcGdeQXVyNjQxMDY4MzA@._V1_.jpg", "description": "Finch&apos;s number comes up when his cover identity is blown and sets off a deadly series of encounters with Samaritan&apos;s operatives.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt4679206/"}, "author": {"@type": "Person", "name": "mvqa"}, "dateCreated": "2016-06-06", "inLanguage": "English", "name": "The best episode of Person Of Interest so Far", "reviewBody": "&quot;Can you hear me?&quot;\n\nWhile I am really mad that they cancelled this show, I am really glad they are ending it with a bang. \n\nThis is the best episode I&apos;ve seen in a very long time on any show. It&apos;s full of action, excitement and emotion, a lot of emotion. From the very first second the pace is really fast and you are completely entertained. And what can I say about the end? The last minutes were really emotional and at the same time exciting. You know you are watching a great show when you don&apos;t want it to end.\n\nI can&apos;t wait to see the final 3 episodes.\n\nThis is the right way to make an episode #100.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 6259, "bestRating": 10, "worstRating": 1, "ratingValue": 9.7}, "contentRating": "TV-14", "genre": ["Action", "Crime", "Drama"], "datePublished": "2016-05-31", "keywords": "death,professor,underground parking garage,dead body on a slab,deceased", "trailer": {"@type": "VideoObject", "name": "Person Of Interest: The Day The World Went Away", "embedUrl": "/video/imdb/vi1405730073", "thumbnail": {"@type": "ImageObject", "contentUrl