{"url": "https://www.imdb.com/title/tt6048596/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt6048596/", "name": "The Sinner", "image": "https://m.media-amazon.com/images/M/MV5BMjBkZDhkNzUtNDZhZS00ZDE1LWI1MjQtYjQ1OGM3Y2FiMmMwXkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_.jpg", "description": "Anthology series that examines how and why ordinary people commit brutal crimes.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt6048596/"}, "author": {"@type": "Person", "name": "atlasmb"}, "dateCreated": "2017-08-11", "inLanguage": "English", "name": "A Promising Why-dunit", "reviewBody": "Cora (Jessica Biel) is a normal looking young woman who commits a shocking crime in full view of many witnesses. As viewers, we witness the crime also, so there is no doubt of her guilt. \n\nMeans and opportunity are never in question, but what is the motive? That is the central mystery around which this series revolves. And it is the question that drives police detective Harry Ambrose (Bill Pullman) to dig deeper despite Cora&apos;s confession of guilt.\n\nAmbrose is a sad sack character who seems to commune better with nature than with people. Perhaps he understands compulsion and seeks to unravel his own while investigating Cora&apos;s.\n\nIn the first episode, Cora says, &quot;I never thought that I would have a normal life.&quot; This is a major clue that her behavior may be rooted in her early years. Throughout the show, there are flashbacks to various happenings from all periods of Cora&apos;s life--clues that form pieces of the jigsaw puzzle solution. \n\nAs for the acting, most of the heavy hauling involves Biel and Pullman, who are convincing. The tone of the show is moody, suggesting the turmoil that lies just beneath the surface.\n\nIt remains to be seen if the writing can weave a tale that keeps the story interesting over the course of the 8-episode season. This is a good start.\n\nUpdate 8/25/17: After four episodes, I am raising my grade to &quot;8&quot;. The story is riveting. I would recommend this show to anyone who likes a good police mystery.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 8}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 118506, "bestRating": 10, "worstRating": 1, "ratingValue": 7.9}, "contentRating": "TV-MA", "genre": ["Crime", "Drama", "Mystery"], "datePublished": "2017-08-02", "keywords": "trauma trigger,blocked memory,amnesia,past coming back to haunt,older sister younger sister relationship", "actor": [{"@type": "Person", "url": "/name/nm0000597/", "name": "Bill Pullman"}, {"@type": "Person", "url": "/name/nm0372961/", "name": "Jessica Hecht"}, {"@type": "Person", "url": "/name/nm1382564/", "name": "Dohn Norwood"}], "creator": [{"@type": "Organization", "url": "/company/co0221536/"}, {"@type": "Organization", "url": "/company/co0242101/"}, {"@type": "Person", "url": "/name/nm0800455/", "name": "Derek Simonds"}], "trailer": {"@type": "VideoObject", "name": "Season 4 Trailer", "embedUrl": "/video/imdb/vi3920806681", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BM2Q3Y2IxOGItODQ1ZC00ZjM2LWI2NzUtMDBjMzAxMmE3ODRkXkEyXkFqcGdeQWRvb2xpbmhk._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BM2Q3Y2IxOGItODQ1ZC00ZjM2LWI2NzUtMDBjMzAxMmE3ODRkXkEyXkFqcGdeQWRvb2xpbmhk._V1_.jpg", "description": "The Sinner season 4 returns on October 13 to USA."}}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt6048596/"], ["og:site_name", "IMDb"], ["og:title", "The Sinner (TV Series 2017\u20132021) - IMDb"], ["og:description", "The Sinner: Created by Derek Simonds. With Bill Pullman, Jessica Hecht, Dohn Norwood, Adam LeFevre. Anthology series that examines how and why ordinary people commit brutal crimes."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMjBkZDhkNzUtNDZhZS00ZDE1LWI1MjQtYjQ1OGM3Y2FiMmMwXkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1250"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
{"url": "https://www.imdb.com/title/tt0734820/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVEpisode", "url": "/title/tt0734820/", "name": "Episode #2.10", "image": "https://m.media-amazon.com/images/M/MV5BYTdmMmRmNzQtNjc5MS00NWViLWJmMjgtYWY3NWZkMDJlZTllXkEyXkFqcGdeQXVyNzA0MzkzNTU@._V1_.jpg", "description": "Leland is laid to rest and Sarah Palmer tries to accept all that has happened to her family. Dr. Jacoby returns from Hawaii. Cooper prepares to leave Twin Peaks. Mayor Milford objects to his brother&apos;s engagement to a younger woman.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0734820/"}, "author": {"@type": "Person", "name": "Hitchcoc"}, "dateCreated": "2017-06-14", "inLanguage": "English", "name": "More Machinations--Enough for Eleven More Episodes", "reviewBody": "Poor Cooper. He has done so much, but who should show up but another member of the Mod Squad (who worked with Peggy Lipton) and a Mountie. They make accusations against Dale. This is all at the feet of Renault who wants Cooper dead for the lives of his brothers. There are some stupid scenes. The one-eyed wife of Big Ed is so over the top, thinking she is back in high school that her appearance ruins every scene they&apos;re in. Then there&apos;s Leo. What&apos;s going on with him? Bobby is failing to keep Shelley happy. He is all blow and no go and she sees her life and freedom slipping away. This is going to be interesting. Then there&apos;s Norma&apos;s awful mother and some of the other characters who will now play a role. Finally we have Lucy and Dick and on and on.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 9}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 3480, "bestRating": 10, "worstRating": 1, "ratingValue": 7.8}, "contentRating": "TV-14", "genre": ["Crime", "Drama", "Mystery"], "datePublished": "1990-12-08", "keywords": "auteur tv", "actor": [{"@type": "Person", "url": "/name/nm0001492/", "name": "Kyle MacLachlan"}, {"@type": "Person", "url": "/name/nm0648920/", "name": "Michael Ontkean"}, {"@type": "Person", "url": "/name/nm0000749/", "name": "M\u00e4dchen Amick"}], "director": [{"@type": "Person", "url": "/name/nm0711696/", "name": "Tina Rathborne"}], "creator": [{"@type": "Organization", "url": "/company/co0058765/"}, {"@type": "Organization", "url": "/company/co0096021/"}, {"@type": "Organization", "url": "/company/co0029640/"}, {"@type": "Person", "url": "/name/nm0004111/", "name": "Mark Frost"}, {"@type": "Person", "url": "/name/nm0000186/", "name": "David Lynch"}, {"@type": "Person", "url": "/name/nm0110644/", "name": "Tricia Brock"}], "duration": "PT47M", "timeRequired": "PT47M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0734820/"], ["og:site_name", "IMDb"], ["og:title", "\"Twin Peaks\" Episode #2.10 (TV Episode 1990) - IMDb"], ["og:description", "Episode #2.10: Directed by Tina Rathborne. With Kyle MacLachlan, Michael Ontkean, M\u00e4dchen Amick, Dana Ashbrook. Leland is laid to rest and Sarah Palmer tries to accept all that has happened to her family. Dr. Jacoby returns from Hawaii. Cooper prepares to leave Twin Peaks. Mayor Milford objects to his brother's engagement to a younger woman."], ["og:type", "video.episode"], ["og:image", "https://m.media-amazon.com/images/M/MV5BYTdmMmRmNzQtNjc5MS00NWViLWJmMjgtYWY3NWZkMDJlZTllXkEyXkFqcGdeQXVyNzA0MzkzNTU@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "748.9568845618915"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
