{"url": "https://www.imdb.com/title/tt0089218/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0089218/", "name": "The Goonies", "image": "https://m.media-amazon.com/images/M/MV5BODRlMjRkZGEtZWM2Zi00ZjYxLWE0MWUtMmM1YWM2NzZlOTE1XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_.jpg", "description": "A group of young misfits called The Goonies discover an ancient map and set out on an adventure to find a legendary pirate&apos;s long-lost treasure.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0089218/"}, "author": {"@type": "Person", "name": "hangertskaau"}, "dateCreated": "2004-10-01", "inLanguage": "English", "name": "&quot;MY CHILDHOOD DREAM (To be one of them,The GOONIES)&quot;", "reviewBody": "Well,well,well.......this film has became one of my all-time favorite movie!The first time i watched the movie i just couldn&apos;t help myself wishing I was there with them.The movie is so full of adventure!But what really bothered me was the exact date it was filmed!Oh my gosh it was dated back in 1985!I was not even born by that time.....But hey they did a pretty good job!I wish i could owned this in DVD so i can watched anytime &amp; show this to my children.But it was so hard to find. So i guess i just had to stick to our cable.\n\nIt was amazing to see Sean Astin(Mikey)so young and active.You could certainly see the difference he is now in Lord of the Rings trilogy. The story isn&apos;t like any...it was so unique!The place and view are awesome and was actually filmed in the City of Astoria.\n\nMy favorite character is Mikey and Josh.They are two brothers who wants to help their parents.So Mikey,being the youngest wants to find that treasure to save them from Troy&apos;s dad.My favorite lines were.... &quot;When you look in the sky,it will be another town,when you see your friends,it will be in another school&quot;.\n\nIt&apos;s kinda touchy and sentiment....but good!I remember the new album of Ataris(So long Astoria)where it became one of their song.I was reading the lyrics and there was a similarity in the movie.The last part goes like this,\n\n&quot;So long Astoria,i found a map to buried treasure and even if we come home empty-handed we still have our stories of pirate ships &amp; wounded hearts,broken bones and the best of friendships.&amp; when this hourglass out its final grain of sand.I raised my glass to the memories we had.This is my wish,i&apos;m taking them back,I&apos;m taking them all back.&quot;\n\nI remember mouth said the last lines when they were trapped inside the cave.I guess the band members of Ataris saw the movie in their childhood years and like them,we were spell-binded by its great story.\n\nSo long The Goonies,you will be remembered as one of the most amazing movies we had.Just like the movie,&quot;The relics of remembrance are just like shipwrecks only they&apos;re gone faster than the smell of the rain.&quot;\n\nBut for now,you became a resurrected memories from ashes in our childhood dreams......."}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 268344, "bestRating": 10, "worstRating": 1, "ratingValue": 7.7}, "contentRating": "PG", "genre": ["Adventure", "Comedy", "Family"], "datePublished": "1985-06-07", "keywords": "treasure hunt,group of friends,treasure map,teen comedy,treasure", "trailer": {"@type": "VideoObject", "name": "The Goonies Trailer", "embedUrl": "/video/imdb/vi316781849", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMTUyNTc2NjAwOV5BMl5BanBnXkFtZTgwNDk0ODE5NzE@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMTUyNTc2NjAwOV5BMl5BanBnXkFtZTgwNDk0ODE5NzE@._V1_.jpg", "description": "Official trailer of The Goonies"}, "actor": [{"@type": "Person", "url": "/name/nm0000276/", "name": "Sean Astin"}, {"@type": "Person", "url": "/name/nm0000982/", "name": "Josh Brolin"}, {"@type": "Person", "url": "/name/nm0169480/", "name": "Jeff Coh