{"url": "https://www.imdb.com/title/tt1615919/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt1615919/", "name": "Raising Hope", "image": "https://m.media-amazon.com/images/M/MV5BMjBkOTU1OWUtY2FhNy00ODFjLTgxMjItYzQ5MWQ1ZWRjYTI2XkEyXkFqcGdeQXVyNjU2NjA5NjM@._V1_.jpg", "description": "Jimmy becomes a single parent to an infant after her mother, with whom he had a one-night stand, ends up on Death Row.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt1615919/"}, "author": {"@type": "Person", "name": "jsucie"}, "dateCreated": "2021-06-30", "inLanguage": "English", "name": "Underrated Brilliance Cut Short", "reviewBody": "My Name Is Earl-verse continues with this brilliant warm-hearted show about a family dealing with the unexpected challenge of an unplanned baby that comes into their lives. You will see many callbacks and similarities to past shows combined into 4 seasons of good-natured hilarity.\n\nThe cast is terrific with leads Lucas Neff (Jimmy) and Shannon Woodward (Sabrina) being the will they won&apos;t they couple. Martha Plimpton (Virginia) and Garret Dillahunt (Burt) as the young simple uneducated parents to Lucas&apos; Jimmy Chance character. We get flashbacks showing Burt and Virginia&apos;s early life raising a young Jimmy and the mistakes teenage parents make.\n\nA shout-out needs to go to the late Cloris Leachman who played Maw Maw; the grandmother who raised Virginia as her own daughter but who now suffers from the onset of dementia. She plays this character with pure joy and hilarity with many of the shows comedic moments coming from her. I will say I&apos;m sure the ridiculous Cancel Culture would come for this show over some whiny &quot;my feeling are hurt on behalf of those suffering from dementia&quot; garbage if this show was made today.\n\nThis, like My Name is Earl, was a show cut too soon from TV-land and was never able to fully conclude the way it should have in 3 or 4 more seasons. As long as it is able to will be put in my rotating lineup of comedy shows that I run through.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 9}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 37523, "bestRating": 10, "worstRating": 1, "ratingValue": 8}, "contentRating": "TV-PG", "genre": ["Comedy", "Family"], "datePublished": "2010-09-01", "keywords": "character name in title,one night stand,death row,supermarket,baby girl", "actor": [{"@type": "Person", "url": "/name/nm3432505/", "name": "Lucas Neff"}, {"@type": "Person", "url": "/name/nm0000588/", "name": "Martha Plimpton"}, {"@type": "Person", "url": "/name/nm0226813/", "name": "Garret Dillahunt"}], "creator": [{"@type": "Organization", "url": "/company/co0171381/"}, {"@type": "Organization", "url": "/company/co0056447/"}, {"@type": "Organization", "url": "/company/co0020336/"}, {"@type": "Person", "url": "/name/nm0305228/", "name": "Gregory Thomas Garcia"}], "trailer": {"@type": "VideoObject", "name": "Raising Hope: Poking Holes In The Story", "embedUrl": "/video/imdb/vi2706357273", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BZTc2NzBkMzUtZDg3YS00NTcxLWI3MWUtMDlkYzk1ZTc5M2Q4XkEyXkFqcGdeQTNwaW5nZXN0._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BZTc2NzBkMzUtZDg3YS00NTcxLWI3MWUtMDlkYzk1ZTc5M2Q4XkEyXkFqcGdeQTNwaW5nZXN0._V1_.jpg", "description": "Raising Hope: Poking Holes In The Story"}}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt1615919/"], ["og:site_name", "IMDb"], ["og:title", "Raising Hope (TV Series 2010\u20132014) - IMDb"], ["og:description", "Raising Hope: Created by Gregory Thomas Garcia. With Lucas Neff, Martha Plimpton, Garret Dillahunt, Shannon Woodward. Jimmy becomes a single parent to an infant after her mother, with whom he had a one-night stand, ends up on Death Row."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMjBkOTU1OWUtY2FhNy00ODFjLTgxMjItYzQ5MWQ1ZWRjYTI2XkEyXkFqcGdeQXVyNjU2NjA5NjM@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1483.0508474576272"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
