{"url": "https://www.imdb.com/title/tt1257492/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVEpisode", "url": "/title/tt1257492/", "name": "Don&apos;t Tread on Me", "image": "https://m.media-amazon.com/images/M/MV5BMjEyNDYyMzE5MF5BMl5BanBnXkFtZTgwOTUzMTQ2MjE@._V1_.jpg", "description": "John and John Quincy sail to France to join Benjamin Franklin as part of the American mission but Adams&apos; blunt style is ill-suited to diplomacy.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt1257492/"}, "author": {"@type": "Person", "name": "CubsandCulture"}, "dateCreated": "2021-04-10", "inLanguage": "English", "name": "Covers aspects of the revolution that are rarely seen", "reviewBody": "While the timelines, events in this episode are the most jumbled of the series-Adams actually went to France twice and he wrote the Massachusetts constitution between the two trips-it is also centered on things rarely seen for this time period. I cannot recall any other film, popular media that covered the diplomatic intrigue of the Europe in this detail or even brought up Dutch credit. On top of that, Adams come across as nearly incompetent in this episode and it is such an unflattering characterization that it stands out as near criticism.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 688, "bestRating": 10, "worstRating": 1, "ratingValue": 7.8}, "contentRating": "TV-14", "genre": ["Biography", "Drama", "History"], "datePublished": "2008-03-23", "keywords": "reference to charles cornwallis,diplomacy,traitor,eccentric,letter", "actor": [{"@type": "Person", "url": "/name/nm0316079/", "name": "Paul Giamatti"}, {"@type": "Person", "url": "/name/nm0001473/", "name": "Laura Linney"}, {"@type": "Person", "url": "/name/nm0396812/", "name": "Danny Huston"}], "director": [{"@type": "Person", "url": "/name/nm0393799/", "n