{"url": "https://www.imdb.com/title/tt0098773/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0098773/", "name": "Counterstrike", "image": "https://m.media-amazon.com/images/M/MV5BMzZhMDM2MGYtMTFhMS00MDI5LWI2N2MtMzU1MjE0M2VlODA0XkEyXkFqcGdeQXVyNjExODE1MDc@._V1_.jpg", "description": "After his wife is killed in a terrorist operation, international industrialist Alexander Addington assembles a private team of troubleshooters to help combat terrorism around the world.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0098773/"}, "author": {"@type": "Person", "name": "hbelova"}, "dateCreated": "2001-04-04", "inLanguage": "English", "name": "Simon MacCorkindale&apos; character is magnificent", "reviewBody": "After our Russian TV airs  this TV series, I fall in Peter Sinclair starring Simon MacCorkindale. His character is magnificent. I saw many films, that include Simon and I think,  in this show he is at the peak of his career. I remember,  for this role he received a GEMINI nomination for Best Actor in a Series.  Also he was an executive production consultant here. I had seen he exerted  influence to creation of this show, plots etc. I have found out, that it&apos;s fine, fast-moving show,  with the very interesting characters,  remarkable actors, unusual humour. I like the various plots: together with detective investigation, mysticism, psychological thriller,  love affair, in every episode they contemplate any important problem. I watch many detective show (European, Canadian, US), but I think, it&apos;s one of the best."}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 207, "bestRating": 10, "worstRating": 1, "ratingValue": 7.3}, "genre": ["Action", "Adventure"], "datePublished": "1990-07-01", "keywords": "secret group,female spy,counter terrorism,counter spy,billionaire", "actor": [{"@type": "Person", "url": "/name/nm0531546/", "name": "Simon MacCorkindale"}, {"@type": "Person", "url": "/name/nm0001626/", "name": "Christopher Plummer"}, {"@type": "Person", "url": "/name/nm0460637/", "name": "Tom Kneebone"}], "creator": [{"@type": "Organization", "url": "/company/co0077387/"}, {"@type": "Organization", "url": "/company/co0020920/"}, {"@type": "Organization", "url": "/company/co0024390/"}]}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0098773/"], ["og:site_name", "IMDb"], ["og:title", "Counterstrike (TV Series 1990\u20131993) - IMDb"], ["og:description", "Counterstrike: With Simon MacCorkindale, Christopher Plummer, Tom Kneebone, Andre Mayers. After his wife is killed in a terrorist operation, international industrialist Alexander Addington assembles a private team of troubleshooters to help combat terrorism around the world."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMzZhMDM2MGYtMTFhMS00MDI5LWI2N2MtMzU1MjE0M2VlODA0XkEyXkFqcGdeQXVyNjExODE1MDc@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1397.4358974358975"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
