{"url": "https://www.imdb.com/title/tt1786751/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt1786751/", "name": "CBGB", "image": "https://m.media-amazon.com/images/M/MV5BMTg1NDcxODY0OV5BMl5BanBnXkFtZTgwOTgwMzQxMDE@._V1_.jpg", "description": "A look at the New York City punk-rock scene and the venerable nightclub, CBGB.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt1786751/"}, "author": {"@type": "Person", "name": "natrc2003"}, "dateCreated": "2013-10-03", "inLanguage": "English", "name": "Great film about an important moment in music history", "reviewBody": "As someone who was &quot;there&quot; but as an outsider (14-year-old kid from NJ who idolized Punk magazine and especially the Ramones), I loved this film. Yes, I recognize a number of liberties were taken with the truth, but this film allowed me to relive the thrill I used to experience going to CBGB&apos;s (as we called it) back in the day (I started going around 1976 or so). Even more than that, it&apos;s great to get a glimpse of how CBGB&apos;s came to be.\n\nMore than that, the film works great as a film in and of itself -- the directing, pacing, acting and cinematography are all first rate, with nary a dull or dead spot throughout (until the end, but I&apos;ll get to that). I&apos;m not generally one for tricks like the use of Holmstrom&apos;s art to frame the story, but since it&apos;s Punk magazine we&apos;re talking about, it makes perfect sense for this film.\n\nThe film just sails along -- I suppose partly because it&apos;s so much fun to see the various bands, and how much fun the actors had portraying the band members&apos; quirks (the Joey Ramone character is spot on... ). In fact, I would have liked it if the film had been extended to include more of the early groups (they left out Suicide, who were everywhere back then) and more of the live performances. I&apos;m a little torn by the decision to have them lip sync to album material -- on the one hand, it&apos;s the music we remember, on the other hand, most of the bands have live material available, even recorded at CBGB&apos;s, why not use some of that? \n\nHowever, by the end... the film runs out of steam a bit. I think that comes partly from the decision to focus a bit too much on the Dead Boys storyline, knowing how doomed that band was, and how entirely outclassed they were by most of the other bands featured (Television, Talking Heads, Ramones, Blondie). Fortunately, the film only sags in the last 15 minutes or so, and it&apos;s still not enough to spoil a fine film dealing with a very important part of American -- and world -- music history.\n\nFor me, personally, this period shaped my entire life, certainly from an aesthetic point of view. \n\nAnd great news! There&apos;s now a Best of Punk Magazine book available! (I still have my original copies around somewhere, but I can&apos;t wait to show this book to my kids!)", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 9}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 10241, "bestRating": 10, "worstRating": 1, "ratingValue": 6.5}, "contentRating": "R", "genre": ["Crime", "Drama", "Music"], "datePublished": "2013-10-11", "keywords": "punk,nightclub,blondie the singer character,blonde woman,timeframe 1970s", "trailer": {"@type": "VideoObject", "name": "Trailer #1", "embedUrl": "/video/imdb/vi2956568857", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMTg1NjI3MjMwNF5BMl5BanBnXkFtZTgwODc2NzEwMDE@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMTg1NjI3MjMwNF5BMl5BanBnXkFtZTgwODc2NzEwMDE@._V1_.jpg", "description": " A look at the New York City punk-rock scene and the venerable nightclub, CBGB, run by the incomparable Hilly Kristal."}, "actor": [{"@type": "Person", "url": "/name/nm0000614/", "name": "Alan Rickman"}, {"@type": "Person", "url": "/name/nm0015196/", "name": "Malin Akerman"}, {"@type": "Person", "url": "/name/nm0058581/", "name": "Justin Bartha"}], "director": [{"@type": "Person", "url": "/name/nm0589168/", "name": "Randall Miller"}], "creator": [{"@type": "Organization", "url": "/company/co0132202/"}, {"@type": "Organization", "url": "/company/co0004072/"}, {"@type": "Person", "url": "/name/nm0767713/", "name": "Jody Savin"}, {"@type": "Person", "url": "/name/nm0589168/", "name": "Randall Miller"}], "duration": "PT1H42M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt1786751/"], ["og:site_name", "IMDb"], ["og:title", "CBGB (2013) - IMDb"], ["og:description", "CBGB: Directed by Randall Miller. With Alan Rickman, Malin Akerman, Justin Bartha, Richard de Klerk. A look at the New York City punk-rock scene and the venerable nightclub, CBGB."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTg1NDcxODY0OV5BMl5BanBnXkFtZTgwOTgwMzQxMDE@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1477.7327935222672"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
