{"url": "https://www.imdb.com/title/tt0104500/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0104500/", "name": "In the Line of Duty: Siege at Marion", "image": "https://m.media-amazon.com/images/M/MV5BZWI5ZTk0Y2EtYTdiZC00NjE0LWJhM2ItNzQzNDYzNWM5MTFiXkEyXkFqcGdeQXVyMzU0NzkwMDg@._V1_.jpg", "description": "Bob Bryant, F.B.I. agent in charge of an operation to arrest Adam Swapp and his brother Jonathan are suspects in the bombing of Mormon Center in Utah. The brothers and their families hold-up on their farm with provisions and enoug...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0104500/"}, "author": {"@type": "Person", "name": "shorzfam"}, "dateCreated": "2005-10-14", "inLanguage": "English", "name": "Kind of Boring", "reviewBody": "I haven&apos;t seen this movie since it was first shown on television, thus my memory is hazy. It concerns a small group of Mormon fundamentalists who run afoul of both their less extremist Mormon neighbors and the local sheriff. Disputing issues like polygamous marriage, home schooling and water rights, the situation escalates over a period of time into open warfare, with the catalyst for the final confrontation being the bombing of the local Mormon Stake Center (i.e. church) by the fundamentalists, who hole up at their family farm.\n\nThe F.B.I., led by Dennis Franz, is called in as this is now beyond the control of the local authorities and a Waco-like siege ensues. Frustrated, and unable to make any headway in negotiations, an assault is finally ordered, resulting in the capture of the renegade group but also in the death of a police officer.\n\nThis was not a particularly good movie as the buildup to the final confrontation lacked a sense of drama or inevitability. We feel no empathy for any of the characters except for the policeman who is killed, as he gave his life over what should have been a minor affair that spun out of control because of stupidity masquerading as religious debate. The fundamentalist group takes most of the blame here.\n\nDennis Franz&apos;s character tries to be sympathetic, but not being a Mormon, or even particularly religious, he clearly fails to understand what this is all about. Having written this, I am surprised at the parallels between this incident and the later standoff at Waco, Texas.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 4}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 131, "bestRating": 10, "worstRating": 1, "ratingValue": 5.6}, "contentRating": "PG-13", "genre": ["Action", "Drama"], "datePublished": "1992-02-10", "keywords": "mormon,religion,police,sequel", "actor": [{"@type": "Person", "url": "/name/nm0000893/", "name": "Ed Begley Jr."}, {"@type": "Person", "url": "/name/nm0001240/", "name": "Dennis Franz"}, {"@type": "Person", "url": "/name/nm0002128/", "name": "Tess Harper"}], "director": [{"@type": "Person", "url": "/name/nm0354024/", "name": "Charles Haid"}], "creator": [{"@type": "Organization", "url": "/company/co0060569/"}, {"@type": "Organization", "url": "/company/co0063285/"}, {"@type": "Person", "url": "/name/nm0403913/", "name": "Rick Husky"}], "duration": "PT1H36M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0104500/"], ["og:site_name", "IMDb"], ["og:title", "In the Line of Duty: Siege at Marion (TV Movie 1992) - IMDb"], ["og:description", "In the Line of Duty: Siege at Marion: Directed by Charles Haid. With Ed Begley Jr., Dennis Franz, Tess Harper, Paul Le Mat. Bob Bryant, F.B.I. agent in charge of an operation to arrest Adam Swapp and his brother Jonathan are suspects in the bombing of Mormon Center in Utah. The brothers and their families hold-up on their farm with provisions and enough ammunition to withstand the governments siege. They are devout in their beliefs and purposes and are determined to stand up for their rights."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BZWI5ZTk0Y2EtYTdiZC00NjE0LWJhM2ItNzQzNDYzNWM5MTFiXkEyXkFqcGdeQXVyMzU0NzkwMDg@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1466.7571234735415"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
