{"url": "https://www.imdb.com/title/tt3171732/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt3171732/", "name": "Amanda Todd: The Cycle of Abuse Continues", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt3171732/"}, "author": {"@type": "Person", "name": "leonardodaftson"}, "dateCreated": "2021-12-03", "inLanguage": "English", "name": "Absolutely Tasteless", "reviewBody": "Backstory: Amanda Todd was a 15-year-old high school student from Canada who committed suicide in 2012. Prior to her death, Amanda uploaded an emotional video to YouTube using flash cards to detail the motives behind her suicide. These motives include struggling with mental health, being blackmailed into exposing her breasts on webcam, being bullied, and being physically assaulted. The YouTube video went viral shortly after her death, resulting in Amanda&apos;s story gaining widespread media attention.\n\n&quot;Amanda Todd: The Cycle of Abuse Continues&quot; is a very short video posted by creator Matthew Berdyck to Facebook in 2012 during the pinnacle of Amanda&apos;s media coverage. This poorly-edited short video does nothing to actually discuss or raise awareness to issues like mental health, bullying, sextortion, or suicide. Instead, the short video comes across as a very obvious ploy by the creator to piggyback off a high profile tragedy in a shameful attempt to further his own filmmaking career.\n\nWhat&apos;s truly disgusting about &quot;Amanda Todd: The Cycle of Abuse Continues&quot; is creator Matthew Berdyck included the uncensored images of Amanda Todd&apos;s exposed breasts in his short video. This is a downright repugnant decision by someone who has zero empathy for a suicide victim or her family. Not to mention the glaring fact that these are illicit images of a teenage girl.\n\nThe short video was (rightfully) removed by Facebook after being reported by many users. To this day, creator Matthew Berdyck sadly still uses this short video to pad his filmmaking resume; however, make no mistake, &quot;Amanda Todd: The Cycle of Abuse Continues&quot; is just another black mark on Matthew&apos;s legacy. A legacy that is already rife with controversy and infamy.\n\n1/10 rating, I would rate 0 if I could.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 1}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 132, "bestRating": 10, "worstRating": 1, "ratingValue": 1}, "genre": ["Short"], "datePublished": "2012-10-13", "director": [{"@type": "Person", "url": "/name/nm5556666/", "name": "Matthew Berdyck"}], "creator": [{"@type": "Organization", "url": "/company/co0418187/"}]}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt3171732/"], ["og:site_name", "IMDb"], ["og:title", "Amanda Todd: The Cycle of Abuse Continues (Short 2012) - IMDb"], ["og:description", "Amanda Todd: The Cycle of Abuse Continues: Directed by Matthew Berdyck."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/G/01/imdb/images/social/imdb_logo.png"], ["og:image:height", "1000"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
