{"url": "https://www.imdb.com/title/tt1403862/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt1403862/", "name": "Sinbad: The Fifth Voyage", "image": "https://m.media-amazon.com/images/M/MV5BMTk2MTc5ODM0Nl5BMl5BanBnXkFtZTgwMDkwMTA5MjE@._V1_.jpg", "description": "When the Sultan&apos;s daughter, Princess Parisa is taken by an evil sorcerer, Sinbad is tasked with travelling to a desert of magic and creatures to save her.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt1403862/"}, "author": {"@type": "Person", "name": "sashairk"}, "dateCreated": "2014-12-11", "inLanguage": "English", "name": "Bad and amateurish", "reviewBody": "When I see many 1- and 2-star reviews along with 5-star reviews my conclusion is that the movie is really bad and the 5-star reviews are written by the friends, family members and the people who made it. \n\nI could force myself to watch only first 20 minutes of this &apos;masterpiece.&apos; The animation is primitive like in the school movie, the acting is bad. I was surprised to learn, actually, that this is a US- made film. It looked more like some poorly made Bollywood flick, although they can make pretty good films there. I just wonder how such a fine actor like Patrick Stewart could lend his voice to such a trash. Well, money talks, I guess.\n\nDon&apos;t waste your time on this one unless you want to see how a really bad B-movie looks like.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 1}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 4586, "bestRating": 10, "worstRating": 1, "ratingValue": 4.7}, "contentRating": "PG-13", "genre": ["Action", "Adventure", "Fantasy"], "datePublished": "2014-02-07", "keywords": "sinbad the sailor character,sultan,sorcerer,evil sorcerer,sword and sorcery", "trailer": {"@type": "VideoObject", "name": "Theatrical Trailer", "embedUrl": "/video/imdb/vi3431574297