{"url": "https://www.imdb.com/title/tt1033631/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt1033631/", "name": "Six Days", "alternateName": "Six Days in June", "image": "https://m.media-amazon.com/images/M/MV5BMjljZDljZTMtY2Q1ZC00YTRlLTg5ZmUtZWZlNjU0OGEyYzhkXkEyXkFqcGdeQXVyMjMyMzI4MzY@._V1_.jpg", "description": "The shooting lasted on six tense days in June 1967, but the Six Day War has never really ended. Every crisis that has ripped through this region in the ensuing decades stems from those six fateful days. On its 40th anniversary, th...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt1033631/"}, "author": {"@type": "Person", "name": "DeeNine-2"}, "dateCreated": "2008-01-25", "inLanguage": "English", "name": "Clear, very watchable account", "reviewBody": "This DVD is taken from the WGBM production directed by Ilan Ziv. It is admirably objective considering that Ziv was born in Israel and fought in the Yom Kippur War of 1973. He came to the US and graduated from New York University&apos;s film school soon afterwards.\n\nThe film consists of interviews with soldiers and politicians from both the Arab and Israeli side along with footage shot during the war. I say the film is &quot;admirably objective&quot; but of course there is no such thing as absolute objectivity in such matters, and I am sure that Arab viewers will find the production disagreeable. This disagreement may stem largely from the fact that the Six Day War in June, 1967 was an unmitigated disaster for Syria, Egypt, Lebanon, and especially for Palestine.\n\nHowever, Israel&apos;s swift and decisive victory brought with it no lasting peace. It did however humiliate the Arabs who imagined that they should be able to defeat such a tiny nation as Israel with Allah on their side and great leadership from Egypt&apos;s charismatic President Gamal Adbel Nassar and Jordan&apos;s King Hussein. To save face Arab leaders have done two things. One, they have inculcated the faithful with the notion that Israel won only because the US and other allies helped them; and Two, they have refused to acknowledge defeat holding onto the notion that the war is not over and that the Arab nations will yet achieve victory.\n\nZiv&apos;s film emphasizes the political nature of the conflict, revealing the thinking of leaders on both sides, showing how Moshe Dayan assumed a position of power and influence just prior to the war and how Nassar deluded himself (or was deluded by his military people) into thinking the combined forces of Egypt, Syria and Jordan could defeat the Israelis. In the United States President Lyndon Johnson was advised by his military people that if the Israelis struck first they would win in a week or so, if second, it would take them perhaps two weeks. Johnson remarked (at the time mired in Vietnam) that his generals did a great job of analyzing prospective wars in which they would not be involved, or words to that effect.\n\nZiv reminds the viewer that the war could have escalated into a much wider conflict, possibly bringing in the Soviet Union on the side of the Arabs and the US on the side of Israel. Some teletype messages between Soviet Premier Aleksei Kosygin and Johnson are recalled.\n\nSome facts gleaned from the film: Israel struck first with well-timed, precision bombing of Arab airfields so that the Arab states were left with no air power. The war was, effectively speaking, over then within hours of its start. However, when the report of the air disaster reached Nassar, instead of seeking peace as fast as possible, he ordered propaganda broadcasts repeat with fictitious &quot;victories.&quot; Black and white film clips show the Arabs in jubilant celebration. How cruel it was when the truth came a few days later.\n\nIsraeli&apos;s preemptive first strike was prompted by the military build up by Egypt and Nassar&apos;s closing of the Strait of Hormuz, which most authorities consider an act of war. The film strongly suggests that if Israel had not acted first it would have suffered many more casualties, especially from Arab air power.\n\nAnd then there is the famous phone call from the Arab states that never came. The Israelis were willing to trade land for peace, but the Arabs decided to pretend that the war would continue and so they did not negotiate a peace treaty. The reason the actual fighting ended is because the super powers and the United Nations demanded that Israel halt its advances.\n\nThere is some almost nostalgic footage of Moshe Dayan, Israeli&apos;s heroic Defense Minister who led the armed forces to victory, and some of indecisive Prime Minister Levi Eshkol. Ziv recreates the story of their difference of opinion on what Israel should do and how Dayan&apos;s position prevailed.\n\nThe real losers in the war have turned out to be the Palestinian people who have been under occupation since the war ended. The Arab states that were instrumental in bringing about this human tragedy seem content to blame Israel while doing nothing substantive to help the Palestinians. Indeed a significant portion of the terrorism directed at Israel and the West is motivated by spiteful spasms of revenge by Arabs who are desperate to somehow erase what they see as a humiliating defeat. How much wiser it would be to realize that what happened in 1967 reflects not at all on the manhood of anyone living today, or even then for that matter. Israel won because it could not lose. &quot;Manhood&quot; and heroic acts of valor or lack thereof have nothing to do with it.\n\nSadly, as many others have noted, Israel may win all the battles and all the wars and yet never achieve peace. Theirs is an unenviable position. As long as they exist in the midst of Arab nations who hate them and teach their children to hate, they will always be on a military footing. Only when the old hatreds die, some many years from now, will there be lasting peace in the Holy Lands.\n\n(Note: Over 500 of my movie reviews are now available in my book &quot;Cut to the Chaise Lounge or I Can&apos;t Believe I Swallowed the Remote!&quot; Get it at Amazon!)", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 174, "bestRating": 10, "worstRating": 1, "ratingValue": 7.9}, "contentRating": "Unrated", "genre": ["Documentary", "War"], "datePublished": "2007-06-09", "keywords": "six day war,jordan,syria,middle east,israel", "actor": [{"@type": "Person", "url": "/name/nm0518798/", "name": "Yaron London"}, {"@type": "Person", "url": "/name/nm1559960/", "name": "John Tarzwell"}, {"@type": "Person", "url": "/name/nm0260593/", "name": "Levi Eshkol"}], "director": [{"@type": "Person", "url": "/name/nm0957310/", "name": "Ilan Ziv"}], "creator": [{"@type": "Organization", "url": "/company/co0165044/"}, {"@type": "Organization", "url": "/company/co0196122/"}, {"@type": "Organization", "url": "/company/co0068835/"}, {"@type": "Person", "url": "/name/nm1455534/", "name": "Stephen Phizicky"}, {"@type": "Person", "url": "/name/nm2035598/", "name": "Yair Raveh"}, {"@type": "Person", "url": "/name/nm0957310/", "name": "Ilan Ziv"}], "duration": "PT1H45M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt1033631/"], ["og:site_name", "IMDb"], ["og:title", "Six Days in June (2007) - IMDb"], ["og:description", "Six Days in June: Directed by Ilan Ziv. With Yaron London, John Tarzwell, Levi Eshkol, Gamal Abdel Nasser. The shooting lasted on six tense days in June 1967, but the Six Day War has never really ended. Every crisis that has ripped through this region in the ensuing decades stems from those six fateful days. On its 40th anniversary, the region remains trapped in conflict and is every bit as explosive as it was in 1967. \"Six Days\" chronicles the events of forty years ago with a fresh historical perspective. Beginning with the buildup for the war, and the political and military maneuvering of Israeli Prime Minister Levi Eshkol and Egyptian President Jame Adel Nasser, the film takes us through the six days of fighting, the war with Jordan, the occupation of the West Bank and the annexation of Jerusalem. Featuring stunning archival footage and first-hand accounts of the war from both the Israeli and Arab soldiers who fought it, \"Six Days\" explores how these events became the flash point in history that reshaped the regional political landscape, destroyed old systems and brought new forces to the surface. Rarely in modern times has so short and localized a conflict had such profound global consequences."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMjljZDljZTMtY2Q1ZC00YTRlLTg5ZmUtZWZlNjU0OGEyYzhkXkEyXkFqcGdeQXVyMjMyMzI4MzY@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1444"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
{"url": "https://www.imdb.com/title/tt6298674/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt6298674/", "name": "We Have A Dream", "image": "https://m.media-amazon.com/images/M/MV5BMTIzNjI0NzgtOGFiMC00NTA5LTk0MDctOGM3MTU0MmViZGI0XkEyXkFqcGdeQXVyNjA1NTc4OQ@@._V1_.jpg", "description": "&quot;There is something that I must say to my people...This is Our Hope!&quot; (Rev. Dr. Martin Luther King, Jr., 28 August 1963). During the U.S. Civil Rights Movement, leaders within the American Jewish community, including several Holoc...", "genre": ["Short"], "datePublished": "2016-01-28", "keywords": "martin luther king jr. assassination,israel,social change,jewish community,civil rights", "trailer": {"@type": "VideoObject", "name": "We Have A Dream (2016) (Clip)", "embedUrl": "/video/imdb/vi1310308377", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMDcyZDlmMTktNzg1OS00YTEzLWI3MDEtNjM3N2Q5ZTZiYWY5XkEyXkFqcGdeQXRodW1ibmFpbC1pbml0aWFsaXplcg@@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMDcyZDlmMTktNzg1OS00YTEzLWI3MDEtNjM3N2Q5ZTZiYWY5XkEyXkFqcGdeQXRodW1ibmFpbC1pbml0aWFsaXplcg@@._V1_.jpg", "description": "&quot;There is something that I must say to my people...This is Our Hope!&quot; (Rev. Dr. Martin Luther King, Jr., 28 August 1963)\n\nDuring the U.S. Civil Rights Movement, leaders within the American Jewish community, including several Holocaust survivors, stood side-by-side with Rev. Dr. Martin Luther King, Jr. and leaders within the African-American community of various faiths who were committed to non-violent social change.\n\nJust as he believed in The United States of America, and a just peace for all Americans, Rev. Dr. Martin Luther King, Jr. believed in Israel, and a just peace between Jews and Arabs, Jews and Muslims, Israelis and Palestinians."}, "actor": [{"@type": "Person", "url": "/name/nm0066756/", "name": "Menachem Begin"}, {"@type": "Person", "url": "/name/nm0070050/", "name": "David Ben-Gurion"}, {"@type": "Person", "url": "/name/nm0086550/", "name": "Eugene Carson Blake"}], "director": [{"@type": "Person", "url": "/name/nm1959553/", "name": "Ruth Rachel Anderson-Avraham"}], "creator": [{"@type": "Organization", "url": "/company/co0618298/"}, {"@type": "Person", "url": "/name/nm1959553/", "name": "Ruth Rachel Anderson-Avraham"}], "duration": "PT18M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt6298674/"], ["og:site_name", "IMDb"], ["og:title", "We Have A Dream (Short 2016) - IMDb"], ["og:description", "We Have A Dream: Directed by Ruth Rachel Anderson-Avraham. With Menachem Begin, David Ben-Gurion, Eugene Carson Blake, Eva Jessye Choir. \"There is something that I must say to my people...This is Our Hope!\" (Rev. Dr. Martin Luther King, Jr., 28 August 1963). During the U.S. Civil Rights Movement, leaders within the American Jewish community, including several Holocaust survivors, stood side-by-side with Rev. Dr. Martin Luther King, Jr. and leaders within the African-American community of various faiths who were committed to non-violent social change. Just as he believed in The United States of America, and a just peace for all Americans, Rev. Dr. Martin Luther King, Jr. believed in Israel, and a just peace between Jews and Arabs, Jews and Muslims, Israelis and Palestinians. Bringing together historic footage of the August 1963 March on Washington and the 1960's in the modern State of Israel, \"We Have a Dream\" explores what it means \"to hope\" and \"to be free\"."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTIzNjI0NzgtOGFiMC00NTA5LTk0MDctOGM3MTU0MmViZGI0XkEyXkFqcGdeQXVyNjA1NTc4OQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "562.5"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:l