{"url": "https://www.imdb.com/title/tt2096541/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt2096541/", "name": "Method to the Madness of Jerry Lewis", "image": "https://m.media-amazon.com/images/M/MV5BMjM1MjQyMTY0OF5BMl5BanBnXkFtZTgwNDE0NjAxMzE@._V1_.jpg", "description": "Candid, unfiltered conversations with the iconic comedian.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt2096541/"}, "author": {"@type": "Person", "name": "Lejink"}, "dateCreated": "2014-04-04", "inLanguage": "English", "name": "Jerry Me Lewis", "reviewBody": "According to his various celebrity fans whose adulatory comments proliferate this (auto)biographical documentary, Jerry Lewis is apparently on the same level of comedic genius as Chaplin or Keaton. Unsurprisingly most if not all of his acolytes are American, including the likes of Eddie Murphy, Billy Crystal and Jerry Seinfeld to name but three, but perhaps not being American and missing out on the attendant comic books, cartoon shows, TV specials and telethons which kept him in the public eye Stateside, I don&apos;t think his star is considered quite as bright here in Britain. Me, I don&apos;t see him as being too much above Lou Costello or Britain&apos;s Norman Wisdom in comedic terms and the more his super-fans praised him up, the more resistant I found myself to agreeing with them. \n\nMind you, there&apos;s a bigger Lewis fan here than all of his celebrity friends put together and that&apos;s Lewis himself. Jerry tells one apocryphal-sounding story after another about how he saved Paramount Movies from extinction in the 60&apos;s, analysing his own &quot;genius&quot; (my quotation marks) and generally having us believe that he was a wonderful, kind, generous man from first to last who knew every member of his cast and crew by name. Note to self, Jerry, there&apos;s no honour in self-praise and for good measure he constantly name drops, boasting about his supposed influence on Spielberg, Lucas and Scorcese, even as I have to admit the first of the three is fulsome in his on-screen praise of Lewis here.\n\nAll that said, there are some lovely comic sequences from his movies but hyperbole still gets in the way - at one point an admirer swoons about Jerry making a car act funny, which the clip just doesn&apos;t back up. Of course in this revisionist story, Jerry and Dean amicably broke up and never stopped loving each other, their reunion at the behest of Frank Sinatra during a 1976 Lewis telethon is especially embarrassing with Martin so smashed drunk, he could have been making up with Jerry Lee Lewis and not notice.\n\nInterspersing the story with snippets from a live Lewis in-person modern-day variety performance only shows that cinema was his best medium, although it hardly seems to matter to his sycophantic fans.\n\nI get that Lewis was a big deal in the States and yes, in France too if it means that much to him, but this two hour long special, significantly co-produced by its star lacked a necessary distance and critical point of view and in the end seemed like one long version of &quot;For I&apos;m a jolly good fellow&quot;.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 5}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 351, "bestRating": 10, "worstRating": 1, "ratingValue": 7.2}, "contentRating": "Not Rated", "genre": ["Documentary", "Biography"], "datePublished": "2011-12-17", "keywords": "starz,celebrity interview,famous person", "actor": [{"@type": "Person", "url": "/name/nm0001471/", "name": "Jerry Lewis"}, {"@type": "Person", "url": "/name/nm0000285/", "name": "Alec Baldwin"}, {"@type": "Person", "url": "/name/nm0001938/", "name": "Richard Belzer"}], "director": [{"@type": "Person", "url": "/name/nm1756571/", "name": "Gregg Barson"}], "creator": [{"@type": "Organization", "url": "/company/co0136990/"}, {"@type": "Organization", "url": "/company/co0153917/"}], "duration": "PT1H55M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt2096541/"], ["og:site_name", "IMDb"], ["og:title", "Method to the Madness of Jerry Lewis (TV Movie 2011) - IMDb"], ["og:description", "Method to the Madness of Jerry Lewis: Directed by Gregg Barson. With Jerry Lewis, Alec Baldwin, Richard Belzer, Carol Burnett. Candid, unfiltered conversations with the iconic comedian."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMjM1MjQyMTY0OF5BMl5BanBnXkFtZTgwNDE0NjAxMzE@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1333.3333333333333"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
