{"url": "https://www.imdb.com/title/tt0317705/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0317705/", "name": "The Incredibles", "image": "https://m.media-amazon.com/images/M/MV5BMTY5OTU0OTc2NV5BMl5BanBnXkFtZTcwMzU4MDcyMQ@@._V1_.jpg", "description": "While trying to lead a quiet suburban life, a family of undercover superheroes are forced into action to save the world.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0317705/"}, "author": {"@type": "Person", "name": "basrutten"}, "dateCreated": "2004-12-24", "inLanguage": "English", "name": "Charming and fun", "reviewBody": "Shortly after Dreamworks screwed up with the uninspired &quot;Shark Tale&quot;, Pixar contains its remarkably success story with &quot;The Incredibles&quot;. And while I have to say that I liked &quot;Finding Nemo&quot; a bit better, &quot;The Incredibles&quot; is still an amazing movie.\n\nFirst of all, this is because it&apos;s funny. It&apos;s not so funny that you&apos;re constantly laughing out loud, but there are more than enough good jokes in the movie to keep you entertained, and it&apos;s full of good observations about superhero movies (note all the ridiculous superhero and villain names) and references to other movies. It&apos;s also a brilliant James Bond spoof/homage, containing all the gadgets, secret island bases and crazy schemes that made early Bond movies so much fun.\n\nSecondly, this movie has heart and charm in droves. It&apos;s full of memorably and likable characters you can really identify with and care about. Characters like Edna are instant classics. The voice acting is universally excellent, but Holly Hunter steals the show as Elastigirl. This is a movie that doesn&apos;t need toilet humor, characters modeled like celebrities, or a &quot;hip&quot; soundtrack...it easily succeeds on charm and style alone.\n\nAlso, I found it to be a surprisingly good action movie. The plentiful action sequences are full of energy, extremely fast-paced, and exciting, and put many a live-action movie to shame.\n\nFinally, I also liked the tone and message of the movie. &quot;The Incredibles&quot; basically makes a plea against mediocrity, breaking with the politically correct idea that &quot;everybody is special&quot; (and thus nobody really is), and encouraging people to use the talents they have been given. I think this couldn&apos;t be more true. Not all people are equally talented (just compare Pixar to Dreamworks), but this is no reason to keep the talented people from not reaching their full potential just because it makes the less talented ones feel bad.\n\n&quot;The Incredibles&quot;, while maybe not as hilarious as I had hoped (though it&apos;s still very funny), is nonetheless an extremely entertaining movie, that manages to charm you wit its combination of great characters, lots of style, tongue-in-cheek attitude and good message. Highly recommended.\n\n****1/2 of ***** stars", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 9}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 719025, "bestRating": 10, "worstRating": 1, "ratingValue": 8}, "contentRating": "PG", "genre": ["Animation", "Action", "Adventure"], "datePublished": "2004-11-05", "keywords": "superhero family,superhero,non comic book superhero,secret identity,cgi animation", "trailer": {"@type": "VideoObject", "name": "The Incredibles: Blu-ray Release", "embedUrl": "/video/imdb/vi2963250457", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMjk2ZmY4MTMtZDRmNy00YWM1LThmZWUtMWM3ZmViNzA3ZjU3XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMjk2ZmY4MTMtZDRmNy00YWM1LThmZWUtMWM3ZmViNzA3ZjU3XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg", "description": "New Nomanisan Trailer"}, "actor": [{"@type": "Person", "url": "/name/nm0005266/", "name": "Craig T. Nelson"}, {"@type": "Person", "url": "/name/nm0000168/", "name": "Samuel L. Jackson"}, {"@type": "Person", "url": "/name/nm0000456/", "name": "Holly Hunter"}], "director": [{"@type": "Person", "url": "/name/nm0083348/", "name": "Brad Bird"}], "creator": [{"@type": "Organization", "url": "/company/co0017902/"}, {"@type": "Organization", "url": "/company/co0008970/"}, {"@type": "Person", "url": "/name/nm0083348/", "name": "Brad Bird"}], "duration": "PT1H55M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0317705/"], ["og:site_name", "IMDb"], ["og:title", "The Incredibles (2004) - IMDb"], ["og:description", "The Incredibles: Directed by Brad Bird. With Craig T. Nelson, Holly Hunter, Samuel L. Jackson, Jason Lee. While trying to lead a quiet suburban life, a family of undercover superheroes are forced into action to save the world."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTY5OTU0OTc2NV5BMl5BanBnXkFtZTcwMzU4MDcyMQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1481.111111111111"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
