{"url": "https://www.imdb.com/title/tt0102798/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0102798/", "name": "Robin Hood: Prince of Thieves", "image": "https://m.media-amazon.com/images/M/MV5BNjUxMzVhNjgtYTQxNS00Zjg3LThlYjctOGFlZjg0YmI1ZmYyXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_.jpg", "description": "Robin Hood decides to fight back as an outlaw when faced with the tyranny of the Sheriff of Nottingham.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0102798/"}, "author": {"@type": "Person", "name": "leotard22"}, "dateCreated": "2006-04-17", "inLanguage": "English", "name": "High camp deep in the forest.", "reviewBody": "Although i turned my nose up at this film when first watched fifteen years ago, a second appraisal and a few grey hairs later forces me to see it for what it truly is; a great swashbuckling comedy romp.\n\nAs the pace built, my unease at the somewhat incongruous accents dissipated and i was left to enjoy a great film with some fine performances. Notably from Michael McShane as Friar Tuck and Alan Rickman as the evilly comic Sheriff of Nottingham.\n\nThe pace of the film rarely slackens, building up to a rip roaring finish.\n\nEnjoy.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 192291, "bestRating": 10, "worstRating": 1, "ratingValue": 6.9}, "contentRating": "PG-13", "genre": ["Action", "Adventure", "Drama"], "datePublished": "1991-06-14", "keywords": "robin hood character,jerusalem israel,england,modern minstrel,balladeer", "trailer": {"@type": "VideoObject", "name": "Robin Hood: Prince of Thieves", "embedUrl": "/video/imdb/vi2054227737", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BZWEyMjE2OTQtOGY1Ny00MGMwLTkyNzgtZjU0NTE0NmY2NGYwXkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg"}, "thumbnailUrl": "https://m.media-a