{"url": "https://www.imdb.com/title/tt5843688/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVEpisode", "url": "/title/tt5843688/", "name": "The Path to War Part Two: The Impact of Propaganda on Congressional War Votes", "image": "https://m.media-amazon.com/images/M/MV5BMTkyYjNhYmEtYmIzNC00MWMwLWEyYWEtODgwNzg0NjNkMmFlXkEyXkFqcGdeQXVyMjI4NzkzNjg@._V1_.jpg", "description": "Laurel must work alongside an old boyfriend, Ben Valderrama, when Luke enlists her help in putting together a political documentary to support his anti-war initiative. Also, Laurel worries about the health of Luke and Germaine&apos;s b...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt5843688/"}, "author": {"@type": "Person", "name": "dsteins"}, "dateCreated": "2016-08-31", "inLanguage": "English", "name": "You know a show is good when you wonder if that&apos;s what&apos;s really going on :)", "reviewBody": "Each week the BrainDead writers manage to surprise. In real life I&apos;m not especially good at prognostication. That changes when watching most TV shows - I can often speak the lines in unison with the actors. This show has a great overall plot arc and the individual episodes are full of interesting twists. The chemistry between the actors/actresses is especially strong. Johnny Ray Gill and Nikki M.James as Gustav and Rochelle are great comedy. The forbidden romance of Laurel and Gareth is well executed by Mary Elizabeth Winstead and Aaron Tveit The singer/songwriter recaps at the beginning of the show are hilarious. Hmm...space bugs could explain what&apos;s going on DC.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 289, "bestRating": 10, "worstRating": 1, "ratingValue": 7.8}, "contentRating": "TV-14", "genre": ["Comedy", "Drama", "Horror"], "datePublished": "2016-08-28", "actor": [{"@type": "Person", "url": "/n