{"url": "https://www.imdb.com/title/tt8367618/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "MusicVideoObject", "url": "/title/tt8367618/", "name": "C\u00e9line Dion: Ashes", "image": "https://m.media-amazon.com/images/M/MV5BY2IxMWExNjctMzBkMS00MWI1LTlhZWMtMGQ5YjM4NzlhNmYzXkEyXkFqcGdeQXVyNDQ5MDYzMTk@._V1_.jpg", "description": "Celine Dion&apos;s music video for Deadpool 2.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt8367618/"}, "author": {"@type": "Person", "name": "GamerGuy2110"}, "dateCreated": "2018-07-09", "inLanguage": "English", "name": "Beautiful Song, Surprising Cameo and it goes to eleven", "reviewBody": "At first I was like, &quot;Oh a new song thats probably from a popular motion picture&quot; and god damn, I was right.\n\nAfter two seconds in the song. I was hooked on like a fish before death. Then my favorite Canadian appears on screen. Which I bet everyone was like &quot;Woah, what a comeback after two years in the hidden cloak of harry potter, how did Deadpool and Celine Dion colab together.&quot; tbh I think that question been answered but still unsure whats the real story here.\n\nAfter song ended, It was like a whole new journey started, the journey of DEADPOOL 2. I also put the song on loop because it&apos;s a good power-ballad song after a crush rejects you.\n\nI&apos;ll give it a 11/10 because this song goes to eleven, more than Millie Bobbie Brown&apos;s bald/curly/emo hair kinda. Never seen Stranger Things but I heard it&apos;s interesting and it stars Adam Driver/Keanu Reeves kid from IT.\n\nIn simple form, watch it over eleven times. Even if you love it."}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 1871, "bestRating": 10, "worstRating": 1, "ratingValue": 8.1}, "contentRating": "Not Rated", "genre": ["Short", "Comedy", "Music"], "datePublished": "2018-05-03", "keywords": "music video,superhero,marvel comics,2010s song", "duration": "PT4M"}], "opengra