{"url": "https://www.imdb.com/title/tt12889404/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt12889404/", "name": "Cyrano", "image": "https://m.media-amazon.com/images/M/MV5BNDhhYjU4ZDMtYjI5OC00N2RkLTg5MGItZTNkM2Q5MzE5NjQxXkEyXkFqcGdeQXVyODk2NDQ3MTA@._V1_.jpg", "description": "Too self-conscious to woo Roxanne himself, wordsmith Cyrano de Bergerac helps young Christian nab her heart through love letters.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt12889404/"}, "author": {"@type": "Person", "name": "PedroPires90"}, "dateCreated": "2022-03-16", "inLanguage": "English", "name": "Dull", "reviewBody": "Cringe.\n\nPeter Dinklage is fantastic on this showing his emotions in every single scene just with his eyes (and words...) and Haley Bennett does also a very good job (especially in that final scene). The lighting, costumes and production design are all very good and the third act is quite better than the first two.\n\nNow...this is a bad musical. Every time a song started, I rolled my eyes. This coming from someone who really likes In The Heights and thinks West Side Story is the best film of 2021. It&apos;s incredible how a musical can be so poor in...music! The songs are boring and every one sounds exactly like the other one, the dance is almost inexistent and the numbers very, very weak. Even the way the singing parts are used and how the voices are used...oh lord, sometimes I thought this was supposed to be a parody.\n\nJoe Wright doesn&apos;t know how to film a musical at all - so, so many scenes with dull shots or static camera when it was asking for the opposite - and everything looks super forced. The plot is not great and is super convoluted, but I really think that if this was not a - bad - musical, this could have been a much more interesting view.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 4}}, "aggregateRating": {"@t