{"url": "https://www.imdb.com/title/tt0105046/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0105046/", "name": "Of Mice and Men", "image": "https://m.media-amazon.com/images/M/MV5BYTA4ZTUzODAtZTdmMi00MmMxLThlMDgtY2VhY2Y2MjUxNDEyXkEyXkFqcGdeQXVyMTY5Nzc4MDY@._V1_.jpg", "description": "A nomadic farm worker looks after his dimwitted, gentle-giant friend during the Great Depression.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0105046/"}, "author": {"@type": "Person", "name": "bwianiscool13"}, "dateCreated": "2005-09-15", "inLanguage": "English", "name": "Great from a cinematic standpoint, Not too shabby from a Literary", "reviewBody": "First off, the acting in this movie is incredible. It&apos;s funny how someone as intellectual and bright as Malkovich can pull his role off so well. Gary Sinese was great too, effectively portraying George.\n\nBut if you really get into the book, the movie doesn&apos;t follow it too faithfully. Curely&apos;s wife is portrayed to be flirty, and a &quot;tart,&quot; when in the book, she was just as lonely as everyone else on the ranch. She wasn&apos;t looking for sex, she was looking for companionship. The screenwriter didn&apos;t interpret the book quite as well as I had hoped.\n\nNow I&apos;m just nitpicking, but when when Lennie pulls the stunt by faking the puppy, it&apos;s just not like him. Lennie is not clever at all, and wouldn&apos;t think to do that.\n\nBut all in all, great movie, definitely great for comparing to the book in a lit. class or anywhere.\n\n8/10", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 8}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 43657, "bestRating": 10, "worstRating": 1, "ratingValue": 7.5}, "contentRating": "PG-13", "genre": ["Drama", "Western"], "datePublished": "1992-10-02", "keywords": "simple minded,reference to the novel of mice and men,man 