{"url": "https://www.imdb.com/poll/PHKBOWVN-Kc/", "metadata": {"json-ld": [], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "http://www.imdb.com/poll/PHKBOWVN-Kc/"], ["og:image", "https://m.media-amazon.com/images/M/MV5BODk5MGI1YmQtODVmNy00OWQ4LTk1NjctOWE1MzdkNmE0ZTNmXkEyXkFqcGdeQXVyODc5MTI0NjU@._V1_SY250_CR173,0,250,250_PIimdb-poll-100,BottomRight,1,1_OU12_SL250_.jpg"], ["og:type", "game"], ["og:title", "Poll: 30 Oscar Nominees at the Age of 30 - IMDb - IMDb"], ["og:site_name", "IMDb"], ["og:description", "They were 29 when we were celebrating IMDb's 29th anniversary last year and (coincidentally) 25 when it all started 5 years ago (time flies by the way)... But it seems that 30 marks a serious turning point as far as acting nominations go because we have this year more than 40 actors who've been nominated so far at the age of 30, an observation that prompted us to separate between nominees and winners in order to have less than 35 entries in each poll. So here goes the first round: as you know, we're celebrating the 30th anniversary of our favorite website, here are (would you believe it!) 30 performances that earned their actors an Oscar nomination on the year of their 30th birthday. Which of these performances (ranked chronologically) would you consider your favorite? After the vote, you might discuss the list here (oh, and the * refers to a supporting role) As usual, it's very likely that the actor/actress might not have turned 30 (or 31) before the actual date of the ceremony, but using the same convention as for the last five editions, the age 30 is simply the result of a simple subtraction of years. \"25th Anniversary\" Poll (2015)\n \"26th Anniversary\" Poll (2016)\n\"27th Anniversary\" Poll (2017)\n\"28th Anniversary\" Poll (2018)\n\"29th Anniversary\" Poll (2019)\n"]]}]}}
